import React, { Component } from 'react'
import '../Cssfile/Register.css'
import TextField from '@material-ui/core/TextField';
import IconButton from '@material-ui/core/IconButton';
import Input from '@material-ui/core/Input';
import FilledInput from '@material-ui/core/FilledInput';
import OutlinedInput from '@material-ui/core/OutlinedInput';
import InputLabel from '@material-ui/core/InputLabel';
import InputAdornment from '@material-ui/core/InputAdornment';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Visibility from '@material-ui/icons/Visibility';
import VisibilityOff from '@material-ui/icons/VisibilityOff';
import Button from '@material-ui/core/Button';
import fundoo from '../image/account.svg'


export class Register extends Component {
    handleChange = prop => event => {
        this.setState({ [prop]: event.target.value });
      };

      handleClickShowPassword = () => {
        this.setState(state => ({ showPassword: !state.showPassword }));
      };

    constructor(props) {
        super(props)

        this.state = {
            showPassword: false
        }
    }

    static propTypes = {

    }


    render() {
        return (

            <div className="register" style={{padding:'5%'}} >
                 <div style={{  fontSize:'252%' ,flex:'start' }}> 
                 <span style={{ color: "blue" }}>f</span>
                 <span style={{ color: "red" }}>u</span>
                 <span style={{ color: "orange" }}>n</span>
                 <span style={{ color: "blue" }}>d</span>
                 <span style={{ color: "green" }}>o</span>
                 <span style={{ color: "red" }}>o</span>
               </div>
                <h1 >SignUp</h1>
                <div className="main">

                  <div style={{width:'65%'}}>
                 <div className="name">
                   <TextField
                    required
                    id="outlined"
                    label="Firstname"
                    variant="outlined"
                style={{width:'44%'}} />
                 <TextField
                    required
                    id="outlined"
                    label="Lastname"
                    variant="outlined"
                    style={{width:'44%'}} />
                </div><div className="useremail">
                <TextField
                className="username"
                    required
                    id="outlined"
                    label="Email"
                    variant="outlined"
                    style={{width:'100%'}}/></div>
                <div className="moible">
                  <TextField
                className="username"
                    required
                    id="outlined"
                    label="Phone Number"
                    variant="outlined"
                    style={{width:'94%'}} /></div>


                   <div className="password1">
                   <TextField

                  id="outlined-adornment-password"
                //   className={classNames(classes.margin, classes.textField)}
                  variant="outlined"
                  type={this.state.showPassword ? 'text' : 'password'}
                  label="password"

                  InputProps={{
                    endAdornment: (
                      <InputAdornment position="end" sytle={{width:'1px'}}>

                      </InputAdornment>
                    ),
                  }}
                  style={{width:'44%'}}  />
                 <TextField

                  id="outlined-adornment-password"
                //   className={classNames(classes.margin, classes.textField)}
                  variant="outlined"
                  type={this.state.showPassword ? 'text' : 'password'}
                  label=" Cfm password"
                  value={this.state.password}
                  onChange={this.handleChange('password')}
                  InputProps={{
                    endAdornment: (
                      <InputAdornment position="end" sytle={{width:'1px'}}>
                        <IconButton
                          aria-label="Toggle password visibility"
                          onClick={this.handleClickShowPassword}
                        >
                          {this.state.showPassword ? <VisibilityOff /> : <Visibility />}
                        </IconButton>
                      </InputAdornment>
                    ),
                  }}
                  style={{width:'44%'}}  />
                   </div>

                   <div className="userbutton">
                    <Button variant="contained" color="primary">
                        Submit
                    </Button>
                    <a href="">Aready RegisteredEGISTERED?</a>

</div>   
                </div>

                  <div className="img1"><img src={fundoo} width="250px" height="250px" alt="hello" ></img> 
                  <p> One account.All of Fundoo working  for you</p>
                  </div>
            </div>
            </div>
        )
    }
}

export default Register
